import * as React from 'react';
import { Button, View, Text, StyleSheet, TextInput, TouchableOpacity} from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

// loggin screen
function RegisterScreen({ navigation }) {
  return (
    <View style={styles.view}>
      <TextInput style={styles.inputReg} placeholder="Enter e-mail" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter Password" keyboardType="text"/>

      <TouchableOpacity style={styles.forgotButton} onPress={() => navigation.navigate('Reset Password')}>
        <Text>forgot password</Text>
      </TouchableOpacity>

      <Button title="Register" onPress={() => navigation.navigate('Dashboard')}/>
    </View>
  );
}

// dashboard screen
function DashboardScreen({ navigation }) {
  return (
    <View style={{padding:5,flex: 1, alignItems: 'center', backgroundColor:'white'}}>
          <TouchableOpacity style={{width:"100%", height:80, backgroundColor:'gray', marginTop:30}}
          onPress={()=>navigation.navigate('Fuel Types')}>
            <Text style={{textAlign:'center', fontWeight:'bold',fontSize:30,color:'white',padding:20}}>Fuel</Text>
          </TouchableOpacity>

          <TouchableOpacity style={{width:"100%", height:80, backgroundColor:'gray', marginTop:30}}
          onPress={()=>navigation.navigate('Details')}>
            <Text style={{textAlign:'center', fontWeight:'bold',fontSize:30,color:'white',padding:20}}>Live Queue Map</Text>
          </TouchableOpacity>

          <TouchableOpacity style={{width:"100%", height:80, backgroundColor:'gray', marginTop:30}}
          onPress={()=>navigation.navigate('Details')}>
            <Text style={{textAlign:'center', fontWeight:'bold',fontSize:30,color:'white',padding:20}}>Notifications</Text>
          </TouchableOpacity>
      </View>
  );
}

// rest password screen
function ResetScreen({ navigation }) {
  return (
    <View style={styles.view}>
      <TextInput style={styles.inputReg} placeholder="Enter Name" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter City" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter Phone Number" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter e-mail" keyboardType="text"/>
      <Button title="Next" onPress={() => navigation.navigate('Register')}/>
    </View>
  );
}
// Fuel Types screen
function FuelScreen({ navigation }) {
  return (
    <View style={{padding:5,flex: 1, alignItems: 'center', backgroundColor:'white'}}>
          <TouchableOpacity style={{width:"100%", height:80, backgroundColor:'gray', marginTop:30}}
          onPress={()=>navigation.navigate('Petrol Details')}>
            <Text style={{textAlign:'center', fontWeight:'bold',fontSize:30,color:'white',padding:20}}>Petrol</Text>
          </TouchableOpacity>

          <TouchableOpacity style={{width:"100%", height:80, backgroundColor:'gray', marginTop:30}}
          onPress={()=>navigation.navigate('Details')}>
            <Text style={{textAlign:'center', fontWeight:'bold',fontSize:30,color:'white',padding:20}}>Diesel</Text>
          </TouchableOpacity>

          <TouchableOpacity style={{width:"100%", height:80, backgroundColor:'gray', marginTop:30}}
          onPress={()=>navigation.navigate('Details')}>
            <Text style={{textAlign:'center', fontWeight:'bold',fontSize:30,color:'white',padding:20}}>Kerosine</Text>
          </TouchableOpacity>

          <TouchableOpacity style={{width:"100%", height:80, backgroundColor:'gray', marginTop:30}}
          onPress={()=>navigation.navigate('Details')}>
            <Text style={{textAlign:'center', fontWeight:'bold',fontSize:30,color:'white',padding:20}}>LP Gas</Text>
          </TouchableOpacity>
      </View>
  );  
}

// petrol details
function PetrolScreen() {
  return (
    <View style={styles.view}>

    </View>
  );
}
// Diesel details
function DieselScreen() {
  return (
    <View style={styles.view}>

    </View>
  );
}
// LP Gas details
function LPGasScreen() {
  return (
    <View style={styles.view}>
    </View>
  );
}

// Live Queue Map screen
function MapScreen() {
  return (
    <View style={styles.view}>
      <TextInput style={styles.inputReg} placeholder="Enter Name" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter City" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter Phone Number" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter e-mail" keyboardType="text"/>
    </View>
  );
}
// Notifications screen
function NotificationScreen() {
  return (
    <View style={styles.view}>
      <TextInput style={styles.inputReg} placeholder="Enter Name" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter City" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter Phone Number" keyboardType="text"/>
      <TextInput style={styles.inputReg} placeholder="Enter e-mail" keyboardType="text"/>
    </View>
  );
}


const Stack = createNativeStackNavigator();

// main function
function App() {
  return (
    // navigator
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Register">
        <Stack.Screen name="Register" component={RegisterScreen} />
        <Stack.Screen name="Dashboard" component={DashboardScreen} />
        <Stack.Screen name="Reset Password" component={ResetScreen} />
        <Stack.Screen name="Fuel Types" component={FuelScreen} />
        <Stack.Screen name="Live Queue Map" component={MapScreen} />
        <Stack.Screen name="Notifications" component={NotificationScreen} />
        <Stack.Screen name="Petrol" component={PetrolScreen} />
        <Stack.Screen name="Diesel" component={DieselScreen} />
        <Stack.Screen name="LP Gas" component={LPGasScreen} />
      </Stack.Navigator>
    </NavigationContainer>


  );
}

// styles
const styles = StyleSheet.create({
  view: {
    flex: 1, 
    alignItems: 'center', 
    justifyContent: 'center'
  },
  inputReg: {
    height: 40,
    width: 250,
    margin: 12,
    borderWidth: 1,
    padding: 10,
  },
  forgotButton: {
    alignItems: "center",
    padding: 10,
    marginLeft:150
  },
});


export default App;
